import React from "react";
import styled from "styled-components";
const NumberSelecter = () =>{
    return(
        
  <>
  <Box>1</Box>
  <Box>2</Box>
  <Box>3</Box>
  <Box>4</Box>
  <Box>5</Box>
  <Box>6</Box>
  </>
        
    )
}
export default NumberSelecter;
const Box=styled.div`
height: 72px;
width: 72px;
border: 1px solid black;
display: grid;
place-items: center;
font-size: 24px;
font-weight: 700;
`;
